import React from 'react';
import './App.css';
import Nav from './components/Nav';
import Login from './components/Login';
import CrearServicio from './components/admin/CrearServicio';
import PantallaInicio from './components/PantallaInicio';
import ListarServicios from './components/cliente/ListarServicios';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import { Component } from 'react';

class App extends Component {

  state = {
    data: [],
    modalInsertar: false,
    modalEliminar: false,
    form: {
      id: '',
      nombre: '',
      tipoModal: ''
    }
  }

  render() {
    return (
      <Router>
        <div className="App">
          <Nav />
          <Route path='/Login' component={Login} />
          <Route path='/PantallaInicio' component={PantallaInicio} />
          <Route path='/CrearServicio' component={CrearServicio} />
          <Route path='/ListarServicios' component={ListarServicios} />
        </div>
      </Router>
    );
  }
}

export default App;
